import React from 'react'
import ChampionCard from '../components/ChampionCard.js' // just to test

export default class ChampionsContainer extends React.Component {
  render() {
    return(
      this.props.displayChampions ?
        this.props.displayChampions.map(champion => <ChampionCard champion={champion} />) : console.error('No Champions!')
    )
  }

}
